Приложение сети фабрик , по чистке ковров «Ковер-самолет» 
Приложение,  которое позволяет увидеть  клиенту фабрики информацию о своих бонусах, приемных пунктах и акциях, также вызвать курьера онлайн, произвести оплату онлайн!

Сеть  фабрик «Ковер-самолет» предоставляет комплекс услуг по профессиональной чистке ковров с удалением всех видов загрязнений в том числе и сложных.  Чистка, стирка, удаление неприятных запахов шерсти животных, последствий потопа замена и ремонт оверлока. 
Дополнительно, клиенты фабрики, с помощью приложения имеют возможность:
- посмотреть новости и акции;
- места расположения приемных пунктов, время работы, их телефоны;
- войти в свой Личный кабинет и следить за бонусами;
- посмотреть свои заказы в работе, их статусы, историю заказов;
- подтвердить отправку заказа в работу;
- оплатить заказы банковской картой, бонусами или депозитом;
- связаться с химчисткой по электронной почте, через чат или звонком;
- ознакомиться с прейскурантом на услуги.
